import axios from "axios";
import React, { useRef } from "react";


const Insertdata = () => {
    var txtname = useRef()
    var txtemail = useRef()
    var txtpass = useRef()

    const handleSubmit = (e) => {
        e.preventDefault();

        var name = txtname.current.value
        var email = txtemail.current.value
        var pass = txtpass.current.value

        var a = new FormData();

        a.set('name',name)
        a.set('email',email)
        a.set('password',pass)

        axios.post('https://geton.skmbpk1z.a2hosted.com/insert-data.php',a).then(function (response) {
            
        })
        
    }
    return (
        <>
            <form method="post" onSubmit={handleSubmit}>
                <table>
                    <tr>
                        <td>Name</td>
                        <td>
                            <input type="text" ref={txtname} />
                        </td>
                    </tr>
                    <tr>
                        <td>Email</td>
                        <td>
                            <input type="text" ref={txtemail} />
                        </td>
                    </tr>
                    <tr>
                        <td>Password</td>
                        <td>
                            <input type="text" ref={txtpass} />
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <input type="submit" value={'Submit'} />
                        </td>
                    </tr>
                </table>
            </form>
        </>
    )
}

export default Insertdata;
